import React, {Component} from 'react';
class Pixel extends Component{
    constructor(props){
        super(props);
        this.state = {
            filled: false
        }
    }
    onClickHandler = () => {
        if(!this.state.filled){
            this.setState({filled:this.state.filled = true})
        }
        else{
            this.setState({filled:this.state.filled = false})
        }
    }
    render(){
        return(
            <div onClicker={this.onClickHandler} className={this.state.filled ? "pixel filled" : "pixel"}></div>
        )
    }
}
export default Pixel;
